    "# Create a bar plot with rotated x-axis labels\n",
    "barplot(missing_info$Missing_Count, names.arg = missing_info$Variable, \n",
    "        xlab = \"\", ylab = \"Missing Count\",\n",
    "        col = \"skyblue\", main = \"Count of Missing Data by Variable\",\n",
    "        las = 2, cex.names = 0.8)\n",
    "\n",
    "# Add x-axis label with rotated text\n",
    "mtext(\"Variable\", side = 1, line = 3, padj = 1, srt = 45)"
   ]
