    "# Histogram for numerical data with right skewness\n",
    "numerical_data %>%\n",
    "  keep(skewness_values>2) %>%   \n",
    "  gather() %>%                  \n",
    "  ggplot(aes(value)) + \n",
    "  facet_wrap(~ key, scales = \"free\") +\n",
    "  geom_histogram()"
   ]
